window.bookSummaryJSON = "<p>The queen is back....</p> <p>Her hair is white, her grin is nasty, and she's a little pissed.</p> <p>The war is about to get a whole lot bigger.</p> <p>A breakthrough with the Etheric has given Bethany Anne an edge - and an opportunity to take the fight to the Ooken. </p> <p>What is a good Queen to do when not-so-good neighbors become royal pains in the ass? Baba Yaga comes out to play.</p> <p>Family drama on Devon isn’t the only thing standing in the way of Bethany Anne’s liberation of Moen. </p> <p>A prodigal daughter returns to facilitate Bethany Anne’s solution to Jean’s production woes, her teenagers are being…teenagers, and there isn’t a place in the universe except for Earth she wants to call home. </p> <p>Bethany Anne’s determination to protect her people has no limits. At least, none that she recognizes.</p> <p>The Kurtherians have played a long game, and taken one too many people from Bethany Anne. </p> <p>Her response when she discovers the lengths the seven have gone to? </p> <p>Hold an Etheric Storm in her hands and bend it to her will. There will be hell to pay across the universe. </p> <p>Scroll up and download <i>Finish What You Started</i> right now. Go ahead, there isn't a Kurtherian waiting to bite you. At least, I don't think so. </p>"; 
